.code
MAIN PROC FAR
	                mov  ax, @data
	                mov  ds, ax

	                mov  ax, graphicsMode
	                mov  bx, 0100h
	                int  10h
            
	                MOV  AX, 0
	                INT  33h

	                MOV  AX, 1
	                INT  33h

	                call background
	                call drawlogo
	                call drawgamebtn
	                call drawchatbtn
	                call drawexitbtn

	LOOP1:          
	                mov  AX, 3
	                INT  33h

	                test BX, 1                	; check if key is pressed
	                JZ   LOOP1
	                CMP  CX, gamebtnOffset    	; check min x
	                JL   LOOP1
	                MOV  AX, gamebtnOffset    	; check max x
	                ADD  AX, btnsize
	                CMP  CX, AX
	                JG   LOOP1
	                CMP  DX, gamebtnOffset + 2	; check min y
	                JL   LOOP1
	                MOV  AX, gamebtnOffset + 2
	                ADD  AX, btnsize + 2      	; check if game button is pressed
	                CMP  DX, AX
	                JG   CHECK2
	; Game button is pressed
	                MOV  CX, 10
	                MOV  DX, 10
	                MOv  AL, 3
	                MOV  AH, 0ch
	                INT  10H
	                JMP  LOOP1
	CHECK2:         
	                MOV  AX, chatbtnOffset + 2
	                ADD  AX, btnsize + 2
	                CMP  DX, AX
	                JG   CHECK3
	;Chat button is pressed
	                MOV  CX, 10
	                MOV  DX, 5
	                MOv  AL, 4
	                MOV  AH, 0ch
	                INT  10H
	                JMP  LOOP1
	CHECK3:         
	;Exit button is pressed
	                JMP  LOOP1
        

MAIN ENDP

drawgamebtn PROC
	; initialize containers
	                mov  SI, offset gamebtn
	                mov  cx, btnsize          	;Column X
	                mov  dx, btnsize + 2      	;Row Y
	                mov  ah, 0ch              	;Draw Pixel Command
	Drawitgamebtn:  
	                mov  bl, [SI]             	;use color from array color for testing
	                and  bl, bl
	                JZ   back
	                add  cx, gamebtnOffset
	                add  dx, gamebtnOffset + 2
	                mov  al, [SI]             	;  use color from array color for testing
	                int  10h                  	;  draw the pixel
	                sub  cx, gamebtnOffset
	                sub  dx, gamebtnOffset + 2

	back:           
	                inc  SI
	                DEC  Cx                   	;  loop iteration in x direction
	                JNZ  Drawitgamebtn        	;  check if we can draw c urrent x and y and excape the y iteration
	                mov  Cx, btnsize          	;  if loop iteration in y direction, then x should start over so that we sweep the grid
	                DEC  DX                   	;  loop iteration in y direction
	                JZ   alldrawngamebtn      	;  both x and y reached 00 so finish drawing
	                jmp  Drawitgamebtn
	alldrawngamebtn:ret
drawgamebtn ENDP
drawchatbtn PROC
	; initialize containers
	                mov  SI, offset chatbtn
	                mov  cx, btnsize          	;Column X
	                mov  dx, btnsize + 2      	;Row Y
	                mov  ah, 0ch              	;Draw Pixel Command
	Drawitchatbtn:  
	                mov  bl, [SI]             	;use color from array color for testing
	                and  bl, bl
	                JZ   backchatbtn
	                add  cx, chatbtnOffset
	                add  dx, chatbtnOffset + 2
	                mov  al, [SI]             	;  use color from array color for testing
	                int  10h                  	;  draw the pixel
	                sub  cx, chatbtnOffset
	                sub  dx, chatbtnOffset + 2

	backchatbtn:    
	                inc  SI
	                DEC  Cx                   	;  loop iteration in x direction
	                JNZ  Drawitchatbtn        	;  check if we can draw c urrent x and y and excape the y iteration
	                mov  Cx, btnsize          	;  if loop iteration in y direction, then x should start over so that we sweep the grid
	                DEC  DX                   	;  loop iteration in y direction
	                JZ   alldrawnchatbtn      	;  both x and y reached 00 so finish drawing
	                jmp  Drawitchatbtn
	alldrawnchatbtn:ret
drawchatbtn ENDP
drawexitbtn PROC
	; initialize containers
	                mov  SI, offset exitbtn
	                mov  cx, btnsize          	;Column X
	                mov  dx, btnsize + 2      	;Row Y
	                mov  ah, 0ch              	;Draw Pixel Command
	Drawitexitbtn:  
	                mov  bl, [SI]             	;use color from array color for testing
	                and  bl, bl
	                JZ   backexitbtn
	                add  cx, exitbtnOffset
	                add  dx, exitbtnOffset + 2
	                mov  al, [SI]             	;  use color from array color for testing
	                int  10h                  	;  draw the pixel
	                sub  cx, exitbtnOffset
	                sub  dx, exitbtnOffset + 2

	backexitbtn:    
	                inc  SI
	                DEC  Cx                   	;  loop iteration in x direction
	                JNZ  Drawitexitbtn        	;  check if we can draw c urrent x and y and excape the y iteration
	                mov  Cx, btnsize          	;  if loop iteration in y direction, then x should start over so that we sweep the grid
	                DEC  DX                   	;  loop iteration in y direction
	                JZ   alldrawnexitbtn      	;  both x and y reached 00 so finish drawing
	                jmp  Drawitexitbtn
	alldrawnexitbtn:ret
drawexitbtn ENDP

background PROC
	                MOV  CX, 640              	;set the width (X) up to ff, dont forget to change this number in the loop
	                MOV  DX, 400              	;set the hieght (Y) up to AA
	                jmp  Start                	;Avoid drawing before the calculations
	Drawitbg:       
	                MOV  AH,0Ch               	;set the configuration to writing a pixel
	                push bx
	; next 6 lines to make the pattern darker
	                cmp  bl, 32
	                jb   DontDarken
	                cmp  bl, 175
	                ja   DontDarken
	                add  bl, 72
	DontDarken:     
	                MOV  AL, bl               	;choose white as color
	                MOV  BH,00h               	;set the page number
	                pop  bx
	                INT  10h                  	;execute the configuration
	Start:          
	                mov  AX, 0                	;  |
	                mov  AL, DL               	;  |  > Multuply DL*Dl and Store in AX then BX
	                Mul  DL                   	;  |
	                mov  bx, AX               	;  |
	                mov  AL, CL               	;  \
	                Mul  CL                   	;  \   > Multuply CL*Cl and Store in AX


	;/////////////THIS LINE CHOOSES THE PATTERN TO BE DRAWN\\\\\\\\\\\\\\\\\\\\\\\\\\\\
	                Xor  bx, AX               	;  Relation between DL^2 and CL^2, Sub : X2-Y2 = Hyberbolic Patterns, Add: X2+Y2 = Circular, OR/AND: Rectangular, Xor: Diagonal
        
        
	                DEC  CX                   	;  loop iteration in x direction
	                JNZ  TRY                  	;  check if we can draw current x and y and excape the y iteration
	                mov  CX, 640              	;  if loop iteration in y direction, then x should start over so that we sweep the grid
	                DEC  DX                   	;  loop iteration in y direction
	                JZ   ENDING               	;  both x and y reached 00 so end program
	TRY:            Sub  BX, 70E4h
	                Jp   Drawitbg             	;js for quarter circle, also parity produces patterns (in addition to formula pattern)
	                jmp  Start                	; loop
	ENDING:         
	                RET


background ENDP

drawlogo PROC
	; initialize containers
	                mov  SI, offset logo
	                mov  cx, logoSizeX         	;Column X
	                mov  dx, logoSizeY    	;Row Y
	                mov  ah, 0ch              	;Draw Pixel Command
	Drawitlogo:     
	                mov  bl, [SI]             	;use color from array color for testing
	                and  bl, bl
	                JZ   backlogo
	                add  cx, logoOffset
	                add  dx, logoOffset + 2
	                mov  al, [SI]             	;  use color from array color for testing
	                int  10h                  	;  draw the pixel
	                sub  cx, logoOffset
	                sub  dx, logoOffset + 2

	backlogo:       
	                inc  SI
	                DEC  Cx                   	;  loop iteration in x direction
	                JNZ  Drawitlogo           	;  check if we can draw c urrent x and y and excape the y iteration
	                mov  Cx, logoSizeX         	;  if loop iteration in y direction, then x should start over so that we sweep the grid
	                DEC  DX                   	;  loop iteration in y direction
	                JZ   alldrawnlogo         	;  both x and y reached 00 so finish drawing
	                jmp  Drawitlogo
	alldrawnlogo:   ret
drawlogo ENDP

